import React from 'react'
import { Canva } from './componente/Canva'
import { Routes, Route, } from "react-router-dom";
import { Camara } from './componente/Camara'


export const Rutas = () => {
  return (
    <Routes>
      <Route path="/" element={<Canva />} />
      <Route path="client" element={<Camara/>} />
    </Routes>



  )
}
